export const Container = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #a0b0c2;
    display: flex;
    align-items: center;
    justify-content: center;
`
//presta atenção nesse apóstrofo, talvez seja melhor usar outra coisa...

